Combined Text:
- Very slow/non-functional HP Smart software on some computers;
 - Official cartridges sometimes not accepted (which is unacceptable given the price of the latter);
 - Unjustified obligation to have to create an account to simply use a printer.

I am generally satisfied with the printer, but the following points could improve my comfort of use:
 - the control panel is very small and unwieldy;
 - the scanners are not done directly from the control panel but via the computer;
 - the paper tray cannot hold an entire ream of paper;
 - I am not convinced that having only one cartridge for 3 colors is more effective than 3 different cartridges (my previous HP printer had 1 cartridge per color);
 - I am not convinced of the ecological merits of keeping the printer on all the time. Personally, I use it mainly on weekends, so I systematically turn it off during the week.

To be improved;
 1. The printing speed is not very good, a bit slow. The printing paper often has to run out and go back before starting printing, which is a waste of time;
 2. The color matching is not very correct, there is still a slight gap between the four-color ink cartridges and the six-color ink cartridges;
 3. The tray is a bit tight, and pulling out the tray will often pull the printer body;
 4. The upper glass shield sometimes gets stuck and cannot be put down smoothly;
 advantage;
 1. It is convenient to add ink and does not leak, which is particularly good;
 2. The user manual and guidance procedures are very good, and anyone who uses it for the first time can handle it smoothly;

1: The machine responds very slowly every time it prints: it receives files slowly and prints slowly;
